settings.labelFunction:
var color;
if(dsData[dsIndex].active !== "true"){
    color = 'rgb(255, 0, 0)';
} else {
    color = 'rgb(39, 134, 34)';
}
return '<span style="border: solid ' + color + '; border-radius: 10px; color: ' + color + '; background-color: #fff; padding: 3px 5px; font-size: 14px">' + 
           '${entityLabel}' + 
        '</span>'

settings.markerImageFunction:
var res;
if (dsData[dsIndex].active !== "true") {
    var res = {
        url: images[0],
        size: 40
    }
} else {
    var res = {
        url: images[1],
        size: 40
    }
}
if (dsData[dsIndex].type == "fp2") {
    var res = {
        url: images[2],
        size: 35
    }
}
if (dsData[dsIndex].type == "location") {
        var res = {
            url: images[3],
            size: 30
        }

}
return res;

